import React from 'react';

const FilterGroup = ({ filter }) => {
  return (
    <>
      <h5 className="text-secondary font-weight-bold mt-2">{filter.category}</h5>
      {filter.items.map = (item) => {
          return (
            <input type="checkbox" checked={item.checked}>{filter.label}</input>
          );
      }}
    </>
  );
}

export default FilterGroup;
